import React from "react";
import { Link } from 'react-router-dom';

import './play.scss';

function importAll(r) {
    let images = {};
    r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
    return images;
}

const images = importAll(require.context('../../assets/play', false, /\.(png|jpe?g|svg)$/));

const Play = () => {
    return (
        <div className='play'>
            <Link className='play-thumb'>
                <img src={images['package-1.png']} />
            </Link>
            <Link>
                <img src={images['wesanderson.png']} />
            </Link>
            <img src={images['jam-package.png']} />
            <img src={images['postcard-2101.jpg']} />
            <img src={images['postcard-2102.jpg']} />
            <img src={images['postcard-2103.jpg']} />
            <img src={images['postcard-2104.jpg']} />
        </div>
    );
};

export default Play;
